/*
 * Complete the 'isValid' function below.
 *
 * The function is expected to return a STRING.
 * The function accepts STRING s as parameter.
 */

function isValid(s) {
    const characters = new Map()
    for (const character of s) {
        const repetitions = characters.get(character) || 0
        characters.set(character, repetitions + 1)
    }
    let result = false
    const reps = new Set()
    const repsMap = new Map()
    let mayor = 0
    characters.forEach((val) => {
        if (mayor < val) { mayor = val }

        if (!reps.has(val)) {
            reps.add(val)
        }
        repsMap.set(val, (repsMap.get(val) + 1) || 1)
    })
    const menor = Array.from(reps).find(el => el !== mayor)
    const repsMayor = repsMap.get(mayor)
    if (reps.size === 1 || reps.size === 0) {
        result = true
    } else if (reps.size === 2 && repsMayor === 1) {
        if (mayor - menor === 1) {
            result = true
        }
    } else if (reps.size === 2 && menor === 1 && repsMap.get(menor) === 1) {
        result = true
    }
    return result ? "YES" : "NO"
}
console.log(isValid("aabbcd"));
console.log(isValid("aabbccddeefghi"));
console.log(isValid("abcdefghhgfedecba"));
console.log(isValid(""));
console.log(isValid("abbccc"));
